Tenania:
'''Tenaniʻa''' (c. 1770–1814) là quốc vương đảo [[Huahine]]. Ông trở thành vua năm 1793 sau khi ám sát người anh cùng cha khác mẹ của mình Teriitaria I<ref>{{Chú thích web |url=http://members.iinet.net.au/~royalty/states/oceania/huahine.html |ngày truy cập=2017-01-24 |tựa đề=Genealogy |archive-date=2016-03-04 |archive-url=https://web.archive.org/web/20160304110815/http://members.iinet.net.au/~royalty/states/oceania/huahine.html }}</ref><ref>[http://www.royalark.net/Tahiti/huahine.htm Royal Ark]</ref>. Ông thoái vị năm 1810 và truyền ngôi cho em ông, Quốc vương [[Mahine Teheiura]].

